const canvas = document.getElementById("canvas")

const context = canvas.getContext('2d')


canvas.width = 840
canvas.height = 473

const img = new Image()


img.src = 'data:image/png;base64,'

img.addEventListener('load', function(){
    context.drawImage(img, 0, 0)
    const scannedImage = context.getImageData(0,0, canvas.width, canvas.height)
    const scannedData = scannedImage.data
    console.log(scannedData)
    for(let i = 0; i < scannedData.length; i += 4){
        const total = scannedData[i] + scannedData[i+1] + scannedData[i+2]
        const greyColor = total/3
        scannedData[i] = greyColor + 200
        scannedData[i+1] = greyColor + 100
        scannedData [i+2] = greyColor
    }
    scannedImage.data = scannedData
    context.putImageData(scannedImage, 0, 0)
    
})

